import React from "react";
import "./App.css";
//Pages
import StartPage from "./pages/StartPage";
//Components
import Navbar from "./components/Navbar";
import GamePage from "./pages/gamePage";
import Footer from "./components/Footer";
import GameOver from "./components/GameOver";

import { BrowserRouter } from "react-router-dom";

import { connect } from "react-redux";
import { setLoadingStatus } from "./actions";

const App = ({ gameStatus, difficulty, questionNumber }) => {
  const selectPage = () => {
    if (questionNumber === 9) return <GameOver />;
    if (gameStatus === true && difficulty !== null) {
      return <GamePage />;
    } else {
      return <StartPage />;
    }
  };

  return (
    <div className="App container">
      <Navbar />
      {selectPage()}
      <Footer />
    </div>
  );
};

const mapStateToProps = (state) => {
  return state;
};

export default connect(mapStateToProps, { setLoadingStatus })(App);
